import React from 'react';
import './assetss/css/App.css';
import "bootstrap/dist/css/bootstrap.css";

/////Test
import Test from './components/test';
import Test2 from './components/test2';

import ConfirmPago from './components/confirmPago';

import Login from './components/Login';
import Home from './components/Home';
import Comuna from './components/Views/Post/Comuna';
import Condominio from './components/Views/Post/RegistrarCondominios';
import Departamento from './components/Views/Post/RegistrarDepartamento';
import Articulo from './components/Views/Post/RegistrarArticulo';
import AgenciaExterna from './components/Views/Post/AgenciaExterna';
import ComunaWS from './components/Views/Get/ListarComunas';
import ComunaEdi from './components/Views/put/Comuna';
import Footer from './components/Layouts/Footer';
import Navbar  from './components/Layouts/Navbar';
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom';
////////////////Articulo
import ArticuloList from './components/Views/Articulo/ArticuloList';
import ArticuloNew  from './components/Views/Articulo/ArticuloNew';
import ArticuloEdi from './components/Views/Articulo/ArticuloEdi';
////////////////Agencia
import AgenciaExternaList from './components/Views/AgenciaExterna/AgenciaExternaList';
import AgenciaExternaNew  from './components/Views/AgenciaExterna/AgenciaExternaNew';
import AgenciaExternaEdi from './components/Views/AgenciaExterna/AgenciaExternaEdi';
////////////////Usuario
import UsuarioList from './components/Views/Usuario/UsuarioList';
import UsuarioNew  from './components/Views/Usuario/UsuarioNew';
import UsuarioEdi from './components/Views/Usuario/UsuarioEdi';


function App() {
  return (
    <React.Fragment>
      <Router>
        <Navbar/>
          <Routes>
          <Route path="/" element ={ props=> ( <Home {...props} />)}></Route>
          <Route path="/login" element ={ props=> ( <Login {...props} />)}></Route>  
          <Route path="/test" element ={ props=> ( <Test {...props} />)}></Route>     
          <Route path="/test2" element ={ props=> ( <Test2 {...props} />)}></Route>     
          <Route path="/confirmPago/:pago/:reserva" element ={ props=> ( <ConfirmPago {...props} />)}></Route>     

    {/* PostRoutes--------- */}
            <Route path="/condominio" element={props => (<Condominio {...props}/>)}></Route>
            <Route path="/Comuna" element ={ props=> ( <Comuna {...props} />)}></Route>
            <Route path="/Comuna/EDIT" element ={ props=> ( <ComunaEdi {...props} />)}></Route>
            <Route path="/departamento" element={props => (<Departamento {...props}/>)}></Route>
            <Route path="/agencia" element={props => (<AgenciaExterna   {...props}/>)}></Route>
    {/* ListarRoutes */}
            <Route path="/listarComuna" element ={ props=> ( <ComunaWS {...props} />)}></Route>
    {/* Articulo */}
            <Route path="/ArticuloList" element ={ props=> ( <ArticuloList {...props} />)}></Route>
            <Route path="/ArticuloNew" element ={ props=> ( <ArticuloNew {...props} />)}></Route>
            <Route path="/ArticuloEdi" element ={ props=> ( <ArticuloEdi {...props} />)}></Route>   
    {/* Agencia */}
            <Route path="/AgenciaExternaList" element ={ props=> ( <AgenciaExternaList {...props} />)}></Route>
            <Route path="/AgenciaExternaNew" element ={ props=> ( <AgenciaExternaNew {...props} />)}></Route>
            <Route path="/AgenciaExternaEdi" element ={ props=> ( <AgenciaExternaEdi {...props} />)}></Route>
    {/* Agencia */}
            <Route path="/UsuarioList" element ={ props=> ( <UsuarioList {...props} />)}></Route>
            <Route path="/UsuarioNew" element ={ props=> ( <UsuarioNew {...props} />)}></Route>
            <Route path="/UsuarioEdi" element ={ props=> ( <UsuarioEdi {...props} />)}></Route>                                
          </Routes>
          <Footer/>  
      </Router>
    </React.Fragment>
  );
}

export default App;
